import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/NavBar/Navbar";
import MyPosts from "./components/MyPosts/Post/MyPosts";

const App = () => {
  return (
      <div className= 'wrapper'>
          <Header/>
          <Navbar/>
          <MyPosts/>
      </div>
  );
}

export default App;
